	('video_description','Enter the intimate lives of three breast cancer survivors: mom, sister, daughter - best friend. Each with a different story of struggle and a battle to be won.  Follow their journey of loneliness, strength, laughter and love.  Breast cancer touches all of us and with support, we\'re stronger together. ','Enter the intimate lives of three breast cancer survivors: mom, sister, daughter - best friend. Each with a different story of struggle and a battle to be won.  Follow their journey of loneliness, strength, laughter and love.  Breast cancer touches all of us and with support, we\'re stronger together.','????? ?????? ???? ????? ???? ?????? ?? ????? ?????: ??? ???? ????  ????? ?????. ????? ??????  ??? ?? ??? ?????? ???? ???? ???????? ???? ??? ???. ????? ????? ??? ?? ???? ???? ????? ??? ???? ???. ','Ingrese la vida íntima de tres sobrevivientes de cáncer de mama: madre, hermana, hija - mejor amigo. Cada uno con una historia diferente de la lucha y una batalla que se ganó. Siga su camino de la soledad, la fuerza, la risa y el amor. El cáncer de mama afecta a todos nosotros y con el apoyo, somos más fuertes juntos.','Ingrese la vida íntima de tres sobrevivientes de cáncer de mama: madre, hermana, hija - mejor amigo. Cada uno con una historia diferente de la lucha y una batalla que se ganó. Siga su camino de la soledad, la fuerza, la risa y el amor. El cáncer de mama afecta a todos nosotros y con el apoyo, somos más fuertes juntos.','Saisissez la vie intime des trois survivants du cancer du sein: maman, soeur, fille - meilleur ami. Chacun avec une histoire différente de la lutte et un combat à gagner. Suivez leur parcours de la solitude, de la force, de rires et d\'amour. Le cancer du sein touche chacun d\'entre nous et avec le soutien, nous sommes plus forts ensemble.','Saisissez la vie intime des trois survivants du cancer du sein: maman, soeur, fille - meilleur ami. Chacun avec une histoire différente de la lutte et un combat à gagner. Suivez leur parcours de la solitude, de la force, de rires et d\'amour. Le cancer du sein touche chacun d\'entre nous et avec le soutien, nous sommes plus forts ensemble.','Geben Sie die intime Leben von drei Frauen mit Brustkrebs: Mutter, Schwester, Tochter - bester Freund. Jeder mit einer anderen Geschichte des Kampfes und der Schlacht zu gewinnen. Folgen Sie ihre Reise von Einsamkeit, Kraft, Lachen und Liebe. Brustkrebs betrifft uns alle und mit Unterstützung können wir gemeinsam stärker.','???? ??? ? ? ??? ???? ?????: ??, ??, ? - ?? ??? ?????? ???. ?? ???? ?? ???? ? ????? ???, ?, ??....??? ???? ???? ???. ???? ?? ???? ??? ?? ? ????. ??? ?? ?????. ??? ??? ? ? ? ?? ??? ? ????. ','???????? ??? ?????????? ???? ??? ????? ????????? ???????? ??? ??????: ????, ??????, ???? - ? ????????? ?????. ???? ??? ?? ??????????? ??????? ??? ????? ??? ??? ???? ??? ?? ????????. ??????????? ?? ?????? ???? ??? ?? ???????, ?? ??????, ?? ????? ??? ??? ?????. ? ???????? ??? ?????? ??????? ????? ??? ??? ?? ??? ??????????, ??????? ?????????? ??? ??????.','?????? ?????? ?????????? ?? ???? ??????? ???? ???: ???, ???? ???. ??? ??? ????? ???? ?? ????. ???? ??? ???? ???? ????? ??????, ???, ???? ?????. ???? ??? ???? ?????? ??? ?????, ????? ????? ???? ????.','Inserisci la vita intima dei tre sopravvissuti al cancro al seno: la mamma, la sorella, la figlia - migliore amico. Ognuno con una storia diversa di lotta e una battaglia da vincere. Seguire il loro cammino di solitudine, la forza, risate e amore. Il cancro al seno tocca tutti noi e con il supporto, siamo più forti insieme.','Digite a vida íntima de três sobreviventes de câncer de mama: mãe, irmã, filha - o melhor amigo. Cada um com uma história diferente de luta e uma batalha a ser vencida. Siga sua jornada de solidão, força, risos e amor. O câncer de mama atinge a todos nós e com o apoio, nós somos mais fortes juntos.','??????? ???????? ????? ???? ???????? ???? ???????? ??????: ????, ??????, ???? - ?????? ????. ?????? ? ?????? ???????? ?????? ? ?????