	('about_copy','In 1992, during a time when thousands were dying from breast cancer yet it was only spoken about in whispers, Mrs. Evelyn H. Lauder launched The Estée Lauder Companies Breast Cancer Awareness (BCA) Campaign to raise awareness for the disease. She encouraged women everywhere to practice breast health, while working tirelessly to raise funds for the critical research needed to find a cure. Twenty years later, in over 70 countries, The BCA Campaign is devoted to defeating breast cancer through education and medical research. The BCA Campaign will continue spreading its lifesaving awareness message globally in the hope of a world in which breast cancer no longer exists.','In 1992, during a time when thousands were dying from breast cancer yet it was only spoken about in whispers, Mrs. Evelyn H. Lauder launched The Estée Lauder Companies Breast Cancer Awareness (BCA) Campaign to raise awareness for the disease. She encouraged women everywhere to practice breast health, while working tirelessly to raise funds for the critical research needed to find a cure. Twenty one years later, in over 70 countries, The BCA Campaign is devoted to defeating breast cancer through education and medical research. The BCA Campaign will continue spreading its lifesaving awareness message globally in the hope of a world in which breast cancer no longer exists.','?? ??? 1992? ??? ???? ?????? ???? ????? ????? ???? ??? ?????? ?? ??? ????? ?????? ????? ?????? ?????? ??? ???? ???? ?????? ????? Estée Lauder ??????? ?????? ????? (BCA) ???? ????? ??????. ??? ???? ?????? ?? ?? ???? ??????? ??? ??? ?????? ?? ????? ??? ??? ?? ??? ???? ??????? ??????? ?????? ???????? ?????? ????. ??? 20 ???? ?? ???? ?? 70 ????? ???? ???? BCA ????? ?????? ??? ????? ????? ?? ???? ??????? ???????? ??????. ?????? ???? BCA ???? ????? ????? ??????? ??????? ??????? ??? ??? ?????? ??? ???? ???? ?? ????? ?????.','En 1992, durante una época en que miles de personas fallecían por cáncer de mama, sólo se hablaba de ello en susurros, la Sra. Evelyn H. Lauder lanzó la campaña de cáncer de mama de Estée Lauder Companies (BCA) Campaña de sensibilización para la enfermedad. Ella animó a las mujeres del mundo para la práctica de salud de la mujer, al mismo tiempo trabajando sin descanso para recaudar fondos para la investigación necesaria para encontrar una cura. Veinte años más tarde, en más de 70 países, la Campaña BCA está dedicada a derrotar el cáncer de mama a través de la educación y la investigación médica. La Campaña BCA continuará la difusión de su mensaje de la conciencia para salvar vidas a nivel mundial con la esperanza de un mundo en el que el cáncer de mama ya no exista.','En 1992, cuando miles de mujeres fallecían a causa del cáncer de mama y no se hablaba abiertamente sobre la enfermedad, la Sra. Evelyn H. Lauder lanzó la Campaña de Concienciación sobre el Cáncer de Mama del Grupo de Compañías Estee Lauder para aumentar el conocimiento sobre la enfermedad. Ella animaba a todas las mujeres a cuidar la salud del pecho mientras trabaja incansablemente en conseguir fondos destinados a la investigación de una cura. 20 años después, en más de 70 países, esta Campaña está dedicada a erradicar el cáncer de mama mediante la educación y la investigación médica. La campaña continúa difundiendo su mensaje global de concienciación con la esperanza de conseguir un mundo sin cáncer de mama.','En 1992, à une époque où des milliers mouraient de cancer du sein en silence, Mme Evelyn H. Lauder a lancé la sensibilisation au cancer du sein de la société Estée Lauder Companies (BCA). Elle a encouragé les femmes du monde entier à pratiquer le dépistage du sein, tout en travaillant sans relâche pour amasser des fonds pour la recherche critique nécessaire pour trouver un remède. Vingt ans plus tard, dans plus de 70 pays, la campagne BCA est consacrée à vaincre le cancer du sein par l\'éducation et la recherche médicale. La campagne BCA va continuer à répandre son message de sensibilisation au niveau mondial dans l\'espoir d\'un monde dans lequel le cancer du sein n\'existe plus.','En 1992, à une époque où des milliers mouraient du cancer du sein en silence, Mme Evelyn H. Lauder a lancé la campagne de sensibilisation au cancer du sein de la société Estée Lauder Companies (BCA) afin de conscientiser les gens à cette maladie. Elle a encouragé les femmes du monde entier à prendre soin de leurs seins, tout en travaillant sans relâche pour amasser des fonds pour la recherche critique nécessaire pour trouver un remède. Vingt ans plus tard, dans plus de 70 pays, la campagne BCA se consacre à vaincre le cancer du sein par l\'éducation et la recherche médicale. La campagne BCA va continuer à répandre son message de sensibilisation au niveau mondial dans l\'espoir d\'un monde sans canc','Seit 1992 konnten im Rahmen der Kampagne weltweit bereits mehr als 48 Millionen US-Dollar generiert und an Hilfs- und Aufklärungsprojekte weitergegeben werden. Mehr als 450 Millionen Dollar an Spendengeldern (Stand Oktober 2012) konnten zusätzlich durch die ebenfalls von Evelyn H. Lauder initiierte, Breast Cancer Reasearch Foundation (BCRF)  an profilierte Krebsforscher und ihre Projekte vergeben werden. Dank dieser Unterstützung wurde unter anderem festgestellt, dass Brustkrebs genetisch bedingt sein kann. Darüber hinaus konnten maßgeschneiderte Therapien entwickelt und über die Existenz der Brustkrebs-Stammzellen aufgeklärt werden. ','1992? ???? ????? ?? ?? ??? ???? <span class=\"nowrap\">?????</span> ? ???? ??? <span class=\"nowrap\">????</span> ?????. ??? ?? ??? ?? ???? ?? ?? ???? ???? ?? ??? ???? ??? ??? ?? ?? ???(BCA)? ???????. ??? ?? ??? ??? ??? ?? ?? ? ?? ???? ???? ??, ??? ??? ??? ?? ??? ???? ?? <span class=\"nowrap\">????</span> ??????. 20?? ?? ??, BCA ???? 70? ??? ???? <span class=\"nowrap\">???</span> ????? ?? ??? ??? ?? ???? ????. BCA ???? <span class=\"nowrap\">???</span> ?? ??? ???? ???? ? ????? ????? ???? <span class=\"nowrap\">???</span> ?? ????.','?? 1992, ???? ????? ???????? ???????? ???????? ??? ??? ??????? ??? ??????, ???? ????? ???? ??? ???? ??????, ? ?? Evelyn H. Lauder ??????????? ??? ?????????? ?????????? ??? ??? ??????? ??? ?????? ??? Estee Lauder Companies (BCA) - ??? ?? ????????? ??? ????? ??? ??? ???? ????. ????????? ???????? ?? ????????? ??? ????? ??? ??????? ????, ??? ????????? ????????? ???????? ??? ?? ???????????? ???????? ??? ??? ?????? ??? ?????????? ???? ???? ?? ?????? ? ????????. ?????? ?????? ????????, ?? ???? ??? 70 ?????, ? ?????????? ?????????? ??? ??? ??????? ??? ?????? ????? ?????????? ?? ??????? ??? ??????? ??? ?????? ???? ??? ??? ?????????? ??? ??? ??????? ??????. ? ?????????? ?? ????????? ?? ???????? ?? ??????? ?????? ??? ????????? ??? ???????? ?? ??? ??? ?????, ?????????? ?? ???? ????? ????? ??????? ??????.','???? 1992, ????? ?? ???? ???? ??? ????? ??? ?? ??? ???? ?? ?????, ????? ?????? ????? ?? ?????? ??????? ????? ??? ?? ???? ???? ????? ????? ?????? ?? ??????? ?????. ??? ????? ???? ??? ????? ????? ??????? ???, ??? ????? ??? ???? ????? ????? ????? ?????? ?????. 20 ???? ????? ????, ?????? ?-70 ??????, ??????? ????? ????? ???? ??? ??? ????? ????? ?????. ??????? ????? ????? ?? ???? ??????? ??? ??????? ????? ???? ?????? ????? ??? ???? ???. ','Nel 1992, quando di tumore al seno ancora non si osava parlare, nonostante migliaia di donne morissero di questa malattia, la Signora Evelyn H. Lauder lanciò la campagna di sensibilizzazione contro il tumore al seno: Breast Cancer Awareness Campaign (BCA). La Signora Lauder incoraggiò le donne di tutto il mondo a prendersi cura della salute del proprio seno, lavorando costantemente per raccogliere fondi da destinare alla ricerca di una cura. Venti anni dopo, in più di 70 paesi, la Campagna Nastro Rosa è dedita a combattere il tumore al seno attraverso l\'informazione e la ricerca medica. La Campagna Nastro Rosa continuerà a diffondere il suo messaggio di sensibilizzazione nella speranza di un mondo senza più il tumore al seno.','Em 1992, altura em que milhares de mulheres morriam de cancro da mama e o tema era mencionado a medo, a Senhora Evelyn H. Lauder criou a Campanha de Prevenção do Cancro da Mama da Companhia Estée Lauder, para chamar a atenção para a doença. Ela encorajou mulheres de todo o mundo a vigiarem melhor o seu corpo, enquanto trabalhava incansavelmente para angariar fundos para pesquisas que levem à descoberta de uma cura. Vinte anos mais tarde, em mais de 70 países, a Campanha de Prevenção do Cancro da Mama (CPCM) dedica-se a combater o cancro da mama através da informação e da pesquisa médica. A CPCM vai continuar a espalhar a sua mensagem a nível mundial, na esperança de um mundo onde o cancro da mama deixe de existir. ','? 1992 ????, ????? ?????????? ?? ???? ????? ??? ??????????? ???????? ??????, ?? ???????? ??? ??? ?????????? ??? ???????????? ?????? ? ??????????, ?????? ?????? ????????? ???????????????? ???????? ?????? ???? ?????. ??? ??????? ?????? ?? ???? ???? ??????????? ?????????? ? ?????? ???????? ? ????????? ?????????? ?????? ? ????? ??????? ?? ????????? ???????? ?????? ????????????, ?????????? ????? ???????? ????????? ???????. ??????, 20 ??? ??????, ??? ????? 70 ????? ????????? ? ???????? ??? ?????? ??? ????? ????? ??????????? ??????????? ? ????????? ??????????? ????????????. ? ?? ????????? ???????????????? ?????? ?? ????? ????  ???? ??? ????? ?? ???????? ? ???? ?????. ','1992???????????????????????Evelyn H. Lauder??????????????????????????Breast Cancer Awareness, BCA??????????????????????????????????????????????????????????20?????????????????????? 70????????????????????????????????????????????????????????????????????????????','1992 y?l?nda binlerce insan?n meme kanserinden dolay? hayat?n? kaybetmesi sadece f?s?lt?larla konu?uluyordu. Bayan Evelyn H. Lauder bu hastal?k için Estée Lauder ?irketleri; Meme Kanseri Bilinçlendirme Kampanyas?\'n? (BCA) ba?latt?. Tüm kad?nlar? meme sa?l??? hakk?nda bilgilendirirken, hastal???n tedavisi için yap?lacak ara?t?rma bütçesine katk?da bulunmak için çal