	(56,'2013-10-01 14:34:15','This is my mom Anne Avella. She is my everything! She is a warrior, she is pure selfless love, she is an adoring mother and grandmother, she is my inspiration, my example of strength, love, beauty, & perseverance, my rock, the glue that hold our family together, my biggest supporter, and she is a two time survivor of breast cancer.  Mom, thank you for being the beacon of light that you are - for showing me, through example, what it is to be a strong woman. I love you CRAZY amounts!','photo_1380638055.jpg'),
